import React from 'react';
import { AppBar, Toolbar, Typography, Button, Box } from '@mui/material';
import FavoriteIcon from "@mui/icons-material/Favorite";
import { Link } from 'react-router-dom';
import './NavBar.css';

const NavBar = () => {
  return (
    <AppBar position="static">
      <Toolbar disableGutters>
      <FavoriteIcon sx={{ display: { xs: "none", md: "flex" }, mr: 1 }} />

        <Typography variant="h6" className="nav-logo">
          FastSync
        </Typography>
        <Box sx={{ flexGrow: 1, display: { xs: "none", md: "flex" } }}>

        <div className="nav-buttons">
          <Button sx={{flexGrow:1, my: 2, color: "white", display: "block" }} color="inherit" component={Link} to="/">Home</Button>
          <Button sx={{ my: 2, color: "white", display: "block" }} color="inherit" component={Link} to="/create">Create Project</Button>
          <Button sx={{ my: 2, color: "white", display: "block" }} color="inherit" component={Link} to="/instances">List Projects</Button>
        </div>
        </Box>
      </Toolbar>
    </AppBar>
  );
};

export default NavBar;
